import React from "react";
import { Menu } from "./style";

function Header() {
  const options = [
    {
      label: "Previsão",
      route: "/",
    },
    {
      label: "Dashboard",
      route: "/dashboard",
    },
  ];

  return <Menu></Menu>;
}

export default Header;
